const header = {
  background: "red"
};

export default function Navheader() {
  return (
    <div className="nav-header">
      <div className="nav-name">Labidi.</div>
      <div className="nav-links-top">
        <a href="">Home</a>
        <span className="space"></span>
        <a href="">Back</a>
      </div>
      <style jsx>{`
        .nav-links-top {
          transform: translate(0%, -100%);
          font-size: 20px;
          margin-right: 100px;
          display: flex;
          justify-content: flex-end;
        }
        .nav-links-top a,
        .nav-links-bottom a {
          color: rgb(155, 152, 152);
          opacity: 0.5;
          position: relative;
        }
        .nav-links-top a:before,
        .nav-links-bottom a:before {
          content: "";
          position: absolute;
          width: 0;
          height: 2px;
          bottom: 0;
          right: 0;
          background-color: #fff;
          visibility: hidden;
          transition: all 0.3s ease-in-out;
        }
        .nav-links-top a:hover:before,
        .nav-links-bottom a:hover:before {
          visibility: visible;
          width: 100%;
        }
        .nav-links-top a:hover,
        .nav-links-bottom a:hover {
          transform: scale(1.3);
          opacity: 1;
        }
        .space {
          margin: 20px;
        }
      `}</style>
    </div>
  );
}
